function mockRouter() {
  return {
    name: "mock-@redwoodjs/router",
    enforce: "pre",
    transform(code, id) {
      if (id.includes("src")) {
        code = code.replace(
          "'@redwoodjs/router'",
          "'storybook-framework-redwoodjs-vite/dist/mocks/MockRouter'"
        );
      }
      return code;
    }
  };
}
export {
  mockRouter
};
